import React from 'react';
import CustomNavbar from '../components/Navbar';

function Browse() {
  return (
    <>
      <CustomNavbar />
      <div className="browse-content">
        <h2>Browse Listings</h2>
        <p>Find the best housing options here!</p>
      </div>
    </>
  );
}

export default Browse;
